text = ""
def reverseComp(text):
    inverse = ""
    for i in range(len(text)):
        if text[i] == "A":
            inverse = inverse + "T"
        elif text[i] == "T":
            inverse = inverse + "A"
        elif text[i] == "C":
            inverse = inverse + "G"
        elif text[i] == "G":
            inverse = inverse + "C"
    inverse = inverse[::-1]
    return inverse

print(reverseComp(text))
